import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import styled from 'styled-components'
import style from './FormStyle.css'
import logo from './logo.png';

export default class PublicNav extends Component {
    render() {
        return (
                <NavWrapper className="navbar navbar-dark px-sm-6">
                    <img src={logo} alt="Logo" />
                    <ul className="nav-list align-items-center">

                            <Link to="/" className="nav-link">
                                <h2 className="AppNameText">FloCash</h2>
                            </Link>

                    </ul>        
                    <Link to="/" className="nav-item ml-auto">

                    </Link> 
            </NavWrapper>
        );
    }
}
const NavWrapper = styled.nav`
    background: white;
    width: 100%;
    box-shadow: 0.0rem 0.5rem 0.9rem whitesmoke;

`
